import React from "react";
import Footer from "../../components/Footer/Footer";
import NavHeader from "../../components/NavHeader/NavHeader";

export default function HomeTemplate({ Component }) {
  return (
    <div>
      <NavHeader />
      <Component />
      <Footer />
    </div>
  );
}
